if (!function_exists('visitors_proof_install')) {
    function visitors_proof_install(){
        global $wpdb;
        $vp_wc_installed = is_visitors_proof_woo_commerce_active();
        $vp_table_visits = $wpdb->prefix . VISITORS_PROOF_TABLE_VISITS;
        $vp_table_icons = $wpdb->prefix . VISITORS_PROOF_TABLE_ICONS;
        $vp_table_ips = $wpdb->prefix . VISITORS_PROOF_TABLE_IPS;
        $vp_table_actions = $wpdb->prefix . VISITORS_PROOF_TABLE_ACTIONS;
        $vp_table_notifications = $wpdb->prefix . VISITORS_PROOF_TABLE_NOTIFICATIONS;
        $vp_table_integrations = $wpdb->prefix . VISITORS_PROOF_TABLE_INTEGRATIONS;
        
        if($wpdb->get_var("SHOW TABLES LIKE '$vp_table_visits'" ) != $vp_table_visits){
            add_option('visitors_proof_version', '1.0.1');
            add_option('visitors_proof_license', false);
            add_option('visitors_proof_site_id', '');
            add_option('visitors_proof_site_domain', '');
            add_option('visitors_proof_enabled', 1);
            add_option('visitors_proof_settings', json_encode(visitors_proof_default_settings()));

