                  KEY `region` (`region`),
                  KEY `post_type` (`post_type`),
                  KEY `device_type` (`device_type`),
                  KEY `referral_type` (`referral_type`),
                  KEY `page_url` (`page_url`)
                ) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;
            ";
            dbDelta($sql);
            
            $sql = "
