            $request = json_decode(wp_remote_retrieve_body($request));
            if(isset($request->status) && $request->status == 'success' && !get_option('visitors_proof_site_id')) {
                update_option('visitors_proof_site_id', $request->site_id);
                update_option('visitors_proof_site_domain', $request->site_domain);
            }
        }
		visitors_proof_log('Plugin Activated');
    }
}

if (!function_exists('visitors_proof_disable')) {
    function visitors_proof_disable() {
        $vp_params = visitors_proof_wp_obj();
        $vp_params['site_id'] = get_option('visitors_proof_site_id');
        $request    = wp_remote_post(
            'https://wp.visitorsproof.com/api/vp_deactvate',
            array(
                'timeout'   => 15,
                'body'      => $vp_params,
            )
        );
        visitors_proof_log('Plugin Disabled');
    }
}

if (!function_exists('visitors_proof_uninstall')) {
    function visitors_proof_uninstall() {
        global $wpdb;
        $vp_params = visitors_proof_wp_obj();
        $vp_params['site_id'] = get_option('visitors_proof_site_id');
        $request    = wp_remote_post(
            'https://wp.visitorsproof.com/api/vp_uninstall',
            array(
                'timeout'   => 15,
                'body'      => $vp_params,
            )
        );
        
        $clear_data = visitors_proof_settings('clear_data');
        if($clear_data){
            delete_option('visitors_proof_version');
            delete_option('visitors_proof_license');
            delete_option('visitors_proof_site_id');
            delete_option('visitors_proof_site_domain');
            delete_option('visitors_proof_enabled');
            delete_option('visitors_proof_settings');
            $tableArray = array(VISITORS_PROOF_TABLE_VISITS, VISITORS_PROOF_TABLE_ICONS, VISITORS_PROOF_TABLE_IPS, VISITORS_PROOF_TABLE_ACTIONS, VISITORS_PROOF_TABLE_NOTIFICATIONS, VISITORS_PROOF_TABLE_INTEGRATIONS);
            foreach ($tableArray as $tablename) {
                $wpdb->query("DROP TABLE IF EXISTS {$wpdb->prefix}$tablename");
            }
        }
	}
}